#include <ut/string.hpp>
using namespace ut;

void rlImGuiAddFantasqueSansMono(float size)
{
    ImFontConfig font_config;
    font_config.MergeMode = false;
    font_config.PixelSnapH = false;
    font_config.OversampleH = 5;
    font_config.OversampleV = 5;
    font_config.FontDataOwnedByAtlas = false;

    static const ImWchar ranges[] = { 0x0020, 0x00FF, 0, };

    cstrview("Fantasque Sans Mono").strncpy(font_config.Name, IM_ARRAYSIZE(font_config.Name));

    auto& io = ImGui::GetIO();

    auto f = io.Fonts->AddFontFromMemoryCompressedTTF(
            FANTASQUE_SANS_MONO_compressed_data,
            FANTASQUE_SANS_MONO_compressed_size,
            size, &font_config, ranges);

    io.FontDefault = f;
}